import {useEffect, useState} from "react";

function FetchDataEffect() {
  const [options, setOptions] = useState([])
  useEffect(
      () =>
          fetch('//www.swapi.tech/api/people')
  )
  return (
      <div>
        <p>Fetch some data and render them during the mount </p>
      </div>
  )
}

function App() {
  return (
    <div className="App">
    <FetchDataEffect/>
    </div>
  );
}

export default App;
